import React from "react";
import "./TodoList.css";

const Ongoing = (props) => {
  return (
    <>
      <div className="OngoingContainer">
        <h1>On-going tasks</h1>
        <form>
          <input
            type="text"
            placeholder="Add a new task..."
            className="OngoingAdd"
            value={props.todoList}
          />
        </form>
      </div>
    </>
  );
};

export default Ongoing;
